con:config.script:
import com.eviware.soapui.model.testsuite.TestStepResult.TestStepStatus
import java.util.Map;
Map<String, String> PROPERTIES_MAP = new HashMap<>();

def DeviceIdentification;
def DeviceCounter = 1400000000000;

for(int i=0;i<10;i++) {
	DeviceIdentification = "ESIM" + (DeviceCounter+=1);

	testRunner.testCase.setPropertyValue('DeviceIdentification', DeviceIdentification);
	PROPERTIES_MAP.put("DeviceIdentification" + i, DeviceIdentification);

   	def tsteprequest = testRunner.runTestStepByName('GetActualMeterReads - Request 1');	
	testRunner.runTestStepByName('Property Transfer');	
	PROPERTIES_MAP.put("CorrelationUid" + i, testRunner.testCase.getPropertyValue( "CorrelationUid" ));

	if( tsteprequest.status == TestStepStatus.OK )
	{
		log.info "request OK for " + (testRunner.testCase.getPropertyValue( "CorrelationUid" )) + " device: " + (testRunner.testCase.getPropertyValue( "DeviceIdentification" ));
	}
	else
	{
		log.error "request NOK for " + (testRunner.testCase.getPropertyValue( "CorrelationUid" )) + " device: " + (testRunner.testCase.getPropertyValue( "DeviceIdentification" ));
	}	
}

sleep(5000)

for(int j=0;j<10;j++) {	
   	testRunner.testCase.setPropertyValue('DeviceIdentification', (PROPERTIES_MAP.get("DeviceIdentification" + j)));
	testRunner.testCase.setPropertyValue('CorrelationUid', (PROPERTIES_MAP.get("CorrelationUid" + j)));

	def tstepresponse = testRunner.runTestStepByName('GetActualMeterReadsResponse - Request 1');

	if( tstepresponse.status == TestStepStatus.OK )
	{
		log.info "response OK for " + (testRunner.testCase.getPropertyValue( "CorrelationUid" ));
	}
	else
	{
		log.error "response NOK for " + (testRunner.testCase.getPropertyValue( "CorrelationUid" ));
	}
}

